As Twitchy reported, Human Rights Watch head Kenneth Roth recently suggested that Hamas&#8217; tunnels into Israel aren&#8217;t a &#8220;rights violation&#8221; as long as the terrorists&#8217; aim is &#8220;to attack or capture soldiers.&#8221;
Today, the UN&#8217;s High Commissioner for Human Rights offered up a doozy of her own:
UN human rights chief Pillay condemns U.S. for supporting Israel&#039;s Iron Dome system: &quot;No such protection has been provided to Gazans.&quot; (AP)&mdash; Avi Mayer (@AviMayer) July 31, 2014
@Slublog @CuffyMeh The full statement is even worse. Makes it sound like US gifted these things to Israel and denied them from Palestinians.&mdash; &nbsp; (@neontaster) July 31, 2014
More from Haaretz:

[Navi] Pillay said that she was appalled at Washington consistently voting against resolutions on Israel in the Human Rights Council, General Assembly and Security Council.
&#8220;They have not only provided the heavy weaponry which is now being used by Israel in Gaza but they&#8217;ve also provided almost $1 billion in providing the &#8216;Iron Domes&#8217; to protect the Israels from rocket attacks,&#8221; she said. &#8220;But no such protection has been provided to Gazans against the shelling.&#8221;

To clarify, the UN&#039;s human rights chief has condemned the U.S. for helping Israel protect its citizens against rockets meant to kill them.&mdash; Avi Mayer (@AviMayer) July 31, 2014
What the hell.
I think it&#039;s important that we reflect on this tweet and consider the mystery of why Israel views the UN as hostile. twitter.com/AviMayer/statu…&mdash; Avi Mayer (@AviMayer) July 31, 2014
And while we&#8217;re at it, remind us again why the United States still has anything to do with the UN? Because for the life of us, we can&#8217;t figure out why we&#8217;d want to be involved with such pieces of scum.
The United Nations is a sick joke: twitter.com/AviMayer/statu…&mdash; &nbsp; (@Slublog) July 31, 2014
@AviMayer @RobProvince Pillay is a raging anti-semite.&mdash; Puim (@NotreDameFan27) July 31, 2014
@AviMayer seriously? Is she on drugs? How do morons achieve such high positions of authority?&mdash; MAE (@impactinvest) July 31, 2014
